.دانيال باديسلاف حارس مرمى روماني ويصل وزنه إلى140كيلو،وتسبب في نزول ناديه من الدرجة الثانية الى الدرجة الرابعة والنادي عاجز عن طرده لأن أمه أحد ملاك وممولي النادي.

إستقال بسبب دانيال4مدربين وتوفي أخر بسبب نوبة قلبية كما اعتزل أحد لاعبي النادي اللعب وراح يبيع لخم.
